import React from 'react';

import {Login,Home,Tela2,Tela3,Imc} from './src/index';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
 
const Stack = createStackNavigator();
const Tab = createMaterialBottomTabNavigator();

function Tabs() {
    return(
        <Tab.Navigator>
            <Tab.Screen name="Home" component={Home} />
            <Tab.Screen name="Tela2" component={Tela2} />
            <Tab.Screen name="Tela3" component={Tela3} />
            <Tab.Screen name="Imc" component={Imc} />
        </Tab.Navigator>
    );
}

const App = () => (
    <NavigationContainer>
        <Stack.Navigator initialRouteName="Login">
            <Stack.Screen name="Login" component={Login} options={{headerTitleStyle:{alignSelf:'center'}}} />
            <Stack.Screen name="Home" component={Tabs} />
        </Stack.Navigator>

    </NavigationContainer>
);

export default App;
